void read(std::istream& in, ::mmx::contract::PuzzleLock& value) {
	value.read(in);
}

void write(std::ostream& out, const ::mmx::contract::PuzzleLock& value) {
	value.write(out);
}

void accept(Visitor& visitor, const ::mmx::contract::PuzzleLock& value) {
	value.accept(visitor);
}

